  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Carolina Sandhills
  National Wildlife Refuge summarizes refuge activities for calendar year 1977. The
  report begins with a summary of weather and habitat conditions during the period.
  A construction and maintenance section covers physical development, rehabilitation
  projects, and fires.  Habitat management discusses croplands, grasslands, farming,
  and wilderness areas.  A wildlife section covers migratory birds, upland game birds,
  big game animals, fish, and furbearers. An interpretation and recreation section
  outlines recreational use, refuge visitation, and law enforcement. Items of interest
  are provided at the end of the report.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
